import {makeAutoObservable} from "mobx"

export default class DataStore{
    constructor() {
        this._table_rows = []
        this._page = 1
        this._totalCount = 0
        this._limit = 3
        makeAutoObservable(this)
    }

    setRows(rows){
        this._rows = rows
    }
    get table_rows(){
        return this._table_rows
    }

    setPage(page) {
        this._page = page
    }
    setTotalCount(totalCount) {
        this._totalCount = totalCount
    }
    setLimit(limit) {
        this._limit = limit
    }


    get page() {
        return this._page
    }
    get totalCount() {
        return this._totalCount
    }
    get limit() {
        return this._limit
    }
}
